INSERT OR REPLACE INTO dictionary_entries (term, pos, gloss, example, source, source_url, license, updated_at, senses_json) VALUES ('900', 'noun', 'The act of spinning 900 degrees in the air, doing two and a half complete turns.', 'He did a 900 off the halfpipe.', 'Wiktionary', 'https://en.wiktionary.org/wiki/900', 'CC BY-SA 3.0', '2026-01-18T22:26:26.000Z', '[{"pos":"noun","gloss":"The act of spinning 900 degrees in the air, doing two and a half complete turns.","example":"He did a 900 off the halfpipe."}]');
INSERT OR REPLACE INTO dictionary_entries (term, pos, gloss, example, source, source_url, license, updated_at, senses_json) VALUES ('905', 'name', 'Suburban areas in the province of Ontario closely surrounding the city of Toronto.', 'The part of the urban region outside the City of Toronto is often referred to locally as "the 905", the telephone area code that distinguishes it from the 416 area code of the City. Because the 905 has mostly been built up since the 1970s it is also common to regard everything there as "the outer suburbs", a useful name that implies that while this recently developed area is an extension of the inner suburbs it is nevertheless different from them.', 'Wiktionary', 'https://en.wiktionary.org/wiki/905', 'CC BY-SA 3.0', '2026-01-18T22:26:32.097Z', '[{"pos":"name","gloss":"Suburban areas in the province of Ontario closely surrounding the city of Toronto.","example":"The part of the urban region outside the City of Toronto is often referred to locally as \"the 905\", the telephone area code that distinguishes it from the 416 area code of the City. Because the 905 has mostly been built up since the 1970s it is also common to regard everything there as \"the outer suburbs\", a useful name that implies that while this recently developed area is an extension of the inner suburbs it is nevertheless different from them."}]');
INSERT OR REPLACE INTO dictionary_entries (term, pos, gloss, example, source, source_url, license, updated_at, senses_json) VALUES ('911', 'name', 'The telephone number for emergency services in the United States, Canada, Mexico, Belize, Costa Rica, Argentina, Uruguay, Ecuador, Saudi Arabia, Egypt, Jordan, Liberia, Ethiopia, the Philippines, Anguilla, Palau, and Tonga.', 'When you call 911 in the United States, a local dispatcher usually answers the phone with "911" or "911. What''s your emergency?"', 'Wiktionary', 'https://en.wiktionary.org/wiki/911', 'CC BY-SA 3.0', '2026-01-18T22:26:22.837Z', '[{"pos":"name","gloss":"The telephone number for emergency services in the United States, Canada, Mexico, Belize, Costa Rica, Argentina, Uruguay, Ecuador, Saudi Arabia, Egypt, Jordan, Liberia, Ethiopia, the Philippines, Anguilla, Palau, and Tonga.","example":"When you call 911 in the United States, a local dispatcher usually answers the phone with \"911\" or \"911. What''s your emergency?\""}]');
INSERT OR REPLACE INTO dictionary_entries (term, pos, gloss, example, source, source_url, license, updated_at, senses_json) VALUES ('976', 'adj', 'Alternative form of 1-976.', NULL, 'Wiktionary', 'https://en.wiktionary.org/wiki/976', 'CC BY-SA 3.0', '2026-01-18T22:26:34.054Z', '[{"pos":"adj","gloss":"Alternative form of 1-976."}]');
INSERT OR REPLACE INTO dictionary_entries (term, pos, gloss, example, source, source_url, license, updated_at, senses_json) VALUES ('988', 'name', 'The telephone number for the suicide prevention lifeline in the United States and Canada.', 'Many still assume that “you call 988 and — much like 911 — that means someone is going to be dispatched to you,” said Hannah Wesolowski, NAMI’s chief advocacy officer. “For the vast majority — almost all callers — that’s not actually the case.”', 'Wiktionary', 'https://en.wiktionary.org/wiki/988', 'CC BY-SA 3.0', '2026-01-18T22:26:33.848Z', '[{"pos":"name","gloss":"The telephone number for the suicide prevention lifeline in the United States and Canada.","example":"Many still assume that “you call 988 and — much like 911 — that means someone is going to be dispatched to you,” said Hannah Wesolowski, NAMI’s chief advocacy officer. “For the vast majority — almost all callers — that’s not actually the case.”"}]');
INSERT OR REPLACE INTO dictionary_entries (term, pos, gloss, example, source, source_url, license, updated_at, senses_json) VALUES ('990', 'noun', 'An IRS form for tax-exempt organizations (such as charities).', 'Tax-exempt non-profits are required to provide their three most recent Form 990s if you ask, per the National Council of Nonprofits.', 'Wiktionary', 'https://en.wiktionary.org/wiki/990', 'CC BY-SA 3.0', '2026-01-18T22:26:31.977Z', '[{"pos":"noun","gloss":"An IRS form for tax-exempt organizations (such as charities).","example":"Tax-exempt non-profits are required to provide their three most recent Form 990s if you ask, per the National Council of Nonprofits."}]');
INSERT OR REPLACE INTO dictionary_entries (term, pos, gloss, example, source, source_url, license, updated_at, senses_json) VALUES ('995', 'name', 'The telephone number for firefighting and emergency ambulance service in Singapore.', NULL, 'Wiktionary', 'https://en.wiktionary.org/wiki/995', 'CC BY-SA 3.0', '2026-01-18T22:26:33.078Z', '[{"pos":"name","gloss":"The telephone number for firefighting and emergency ambulance service in Singapore."}]');
INSERT OR REPLACE INTO dictionary_entries (term, pos, gloss, example, source, source_url, license, updated_at, senses_json) VALUES ('999', 'name', 'The telephone number for emergency services in the United Kingdom, Ireland, Hong Kong, Macau, Malaysia, Bangladesh, Burma, Bahrain, Qatar, the UAE, Kenya, Uganda, Zambia, Zimbabwe, Ghana, Sudan, South Sudan, Sierra Leone, Guyana, Antigua and Barbuda, Saint Lucia, Saint Vincent, Dominica, Kiribati, Samoa, the Solomon Islands, and the Seychelles.', 'I don''t know why they couldn''t just keep it as it was! How hard is it to remember 911?
You mean 999...
I mean 999!
That''s the American one!
Yeah!', 'Wiktionary', 'https://en.wiktionary.org/wiki/999', 'CC BY-SA 3.0', '2026-01-18T22:26:24.191Z', '[{"pos":"name","gloss":"The telephone number for emergency services in the United Kingdom, Ireland, Hong Kong, Macau, Malaysia, Bangladesh, Burma, Bahrain, Qatar, the UAE, Kenya, Uganda, Zambia, Zimbabwe, Ghana, Sudan, South Sudan, Sierra Leone, Guyana, Antigua and Barbuda, Saint Lucia, Saint Vincent, Dominica, Kiribati, Samoa, the Solomon Islands, and the Seychelles.","example":"I don''t know why they couldn''t just keep it as it was! How hard is it to remember 911?\nYou mean 999...\nI mean 999!\nThat''s the American one!\nYeah!"},{"pos":"name","gloss":"The telephone number for law enforcement in Singapore, Lebanon, Saudi Arabia, Eswatini, Botswana, Tanzania, Mauritius, and Trinidad and Tobago."},{"pos":"name","gloss":"The telephone number for firefighting assistance in Malawi and Tonga."},{"pos":"name","gloss":"The telephone number for ambulance services in Poland."}]');